Attributes[rB] = {Orderless}
 
rB[1] = Function[{q, m0, m1}, rA[0][m0]/(2*Sqr[q]) - rA[0][m1]/(2*Sqr[q]) - 
      ((m0^2 - m1^2 + Sqr[q])*rB[0][q, m0, m1])/(2*Sqr[q])]
 
rB[0, 0] = Function[{q, m0, m1}, 
     ((\[Epsilon]*(-m0^2 + m1^2 - Sqr[q]))/(36*Sqr[q]) + 
        (m0^2 - m1^2 + Sqr[q])/(12*Sqr[q]))*rA[0][m0] + 
      ((\[Epsilon]*(m0^2 - m1^2 - Sqr[q]))/(36*Sqr[q]) + 
        (-m0^2 + m1^2 + Sqr[q])/(12*Sqr[q]))*rA[0][m1] + 
      (-((m0^2 - m1^2)^2 - 2*(m0^2 + m1^2)*Sqr[q] + Sqr[q]^2)/(12*Sqr[q]) + 
        (\[Epsilon]*((m0^2 - m1^2)^2 - 2*(m0^2 + m1^2)*Sqr[q] + Sqr[q]^2))/
         (36*Sqr[q]))*rB[0][q, m0, m1]]
 
rB[1, 1] = Function[{q, m0, m1}, (-(m0^2 - m1^2 + Sqr[q])/(3*Sqr[q]^2) + 
        (\[Epsilon]*(m0^2 - m1^2 + Sqr[q]))/(36*Sqr[q]^2))*rA[0][m0] + 
      ((\[Epsilon]*(-m0^2 + m1^2 + Sqr[q]))/(36*Sqr[q]^2) + 
        (m0^2 - m1^2 + 2*Sqr[q])/(3*Sqr[q]^2))*rA[0][m1] + 
      ((\[Epsilon]*(-m0^4 + 2*m0^2*m1^2 - m1^4 + 2*m0^2*Sqr[q] + 
           2*m1^2*Sqr[q] - Sqr[q]^2))/(36*Sqr[q]^2) + 
        (m0^4 - 2*m0^2*m1^2 + m1^4 + m0^2*Sqr[q] - 2*m1^2*Sqr[q] + Sqr[q]^2)/
         (3*Sqr[q]^2))*rB[0][q, m0, m1]]
 
Sqr[(HEPMath`Tensors`Private`n_)?NumericQ] := HEPMath`Tensors`Private`n^2
 
Sqr /: Sqr::usage = "Sqr[t] denotes the full contraction of the tensors t \
with\nitself. It is equivalent to SDot[t,t]."
 
Attributes[rC] = {Orderless}
 
rC[1] = Function[{q1$, q2$, m0$, m1$, m2$}, 
