       (2*SDot[q1$, q2$]^2 - 2*Sqr[q1$]*Sqr[q2$]) - 
      ((SDot[q1$, q2$] + Sqr[q2$])*rB[0][q1$ + q2$, m0$, m2$])/
       (2*SDot[q1$, q2$]^2 - 2*Sqr[q1$]*Sqr[q2$]) + 
      ((-2*SDot[q1$, q2$]^2 + (m0$^2 - m1$^2 + Sqr[q1$])*Sqr[q2$] - 
         SDot[q1$, q2$]*(m1$^2 - m2$^2 + Sqr[q2$]))*rC[0][q1$, q2$, m0$, m1$, 
         m2$])/(2*(SDot[q1$, q2$]^2 - Sqr[q1$]*Sqr[q2$]))]
 
rC[2] = Function[{q1$, q2$, m0$, m1$, m2$}, 
